fn = "RawData\1T-TaS2(point defect)\Gxy0T.mat" %[output:9797e7f1]
loadif(fn) %[output:2146dee3] %[output:24e0e92c] %[output:3b832f24]
%%
margins = [700 770] %[output:5dab8e85]
%%
is_load_useful(fn) %[output:9b738b02] %[output:28a661ec] %[output:222b2331]

%%
%[text] Visible on
gr  = groot();
gr.Units = "normalized";
mp = gr.MonitorPositions;
f1 = figure(1);
f1.Units  = "normalized";
f1.Position = secondNormalization(mp(1,:),[0 0 1 1]);
f1.Visible = "on";
%%
%[text] subplotting
msb = 3 %[output:592085d8]
nsb = 5 %[output:1fc6155f]
axReal = subplot(msb,nsb,1:10,'Tag','axReal'); %[output:9732ed0b]
axReal.Tag %[output:5031c0db]
axDos = subplot(msb,nsb,11,'Tag','axDos'); %[output:9732ed0b]
axHis = subplot(msb,nsb,12,'Tag','axHis'); %[output:9732ed0b]
axZoom = subplot(msb,nsb,13,'Tag','axZoom'); %[output:9732ed0b]
rngs = [1 margins(1);margins(2) size(Gfinal0T,1)];
%%
whichDm = 1 %[control:dropdown:7d70]{"position":[11,12]} %[output:820b94e0]
imgInfo = 2 %[control:dropdown:29e2]{"position":[11,12]} %[output:8c9b7fad]
iv = 952%16 %[control:slider:3507]{"position":[6,9]} %[output:5ff3953a]
xpxl = 320 %[control:slider:8da9]{"position":[8,11]} %[output:31e2e9c1]
ypxl = 318 %[control:slider:11ed]{"position":[8,11]} %[output:2e1f2f5f]
vNow = vm(iv) %[output:48c49863]
%%
%[text] 결측치 처리
% sub_TrueData = ~Gfinal0T(:,:,100) == 0
% ind_TrueData = sub_TrueData(:);
% sz = size(Gfinal0T);
% szTemp = [sz(1)*sz(2),sz(3)];
% Gfinal0T = reshape(Gfinal0T,szTemp);
% Gfinal0T(ind_TrueData,:) = nan
%%
%[text] DataProcessing(dependent on )
rng = rngs(whichDm,:);
Gfinal0T =  zero2nan(Gfinal0T);
G = Gfinal0T(rng(1):rng(2),:,:);%%%%% 속도 결정 단계
Z = ImgFinalZnorm(rng(1):rng(2),:,:);%
g_at = squeeze(G(xpxl,ypxl,:));
gavg = averageG_exceptNan(G);
%%
%[text] ## Graphic
%[text] ### Initial Graphic Elements
%[text] Topography
f1.CurrentAxes = axReal
axReal.Tag
imgRegion(G,Z,imgInfo,iv)
axReal.Tag
hold on
highlightPts(xpxl,ypxl)
hold off
axReal.Tag ='axReal'
%[text] Zoomed Topography
f1.CurrentAxes = axZoom
xrng = (-20:20) +xpxl;
yrng = (-20:20) + ypxl;
imgRegion(G(xrng,yrng,:),Z(xrng,yrng),imgInfo,iv)


%[text] Point STS
f1.CurrentAxes = axDos
% V 
plot(vm,g_at,'Tag','g_at')
hold on
plot(vm,gavg,'Tag','gavg')
hold off
nowV = xline(vm(iv),'Tag','nowV');
xlim([-1 1]*.6)
legend(["point" "Averaged"])
xlabel('V (V)')
ylabel('Averaged LDOS (Arb)')
%[text] Histogram at specific Energy
f1.CurrentAxes = axHis
conductanceMap = G(:,:,iv);
% conductanceMap = conductanceMap(:);
% conductanceMap = conductanceMap(~conductanceMap==0);
histogram(conductanceMap)
xline(g_at(iv),'Tag','nowDos')
% min(conductanceMap)
% max(conductanceMap)
xlabel('LDOS')
ylabel('LDOS')
axHis.Tag = 'axHis'

%[text] Change Pts in GUI
setappdata(f1,'is_dragging',false)
setappdata(f1,'drag_object',[])
setappdata(f1,'iv',iv)
setappdata(f1,'xpxl',xpxl)
setappdata(f1,'ypxl',ypxl)
set(axReal.Children(2), 'ButtonDownFcn', @(src,event) changePts(src,event,G,Z,imgInfo,iv));
set(nowV,'ButtonDownFcn',@(src,event) start_drag(src,event))
set(f1,'WindowButtonUpFcn',@(src,event) stop_drag(src,event))
set(f1, 'WindowButtonMotionFcn',@(src,event) draging(src,event,vm,G,Z,imgInfo))
